import React, { Component } from "react";

class Login extends Component {
  render() {
    return (
      <div className="container-fluid" id="login-form">
        <div className="login-form-content">
          <form action="" className="form-control"></form>
        </div>
      </div>
    );
  }
}

export default Login;
